import React from 'react'
import ReactRotatingText from 'react-rotating-text'
import { Button, Image, Divider } from 'semantic-ui-react'
import iunnologo from './iunnologo.png'
import LoginForm from './LoginForm'


export default class Welcome extends React.Component {

    render() {

        return (
            <div styles={{ backgroundImage:`url(${dinner})` }}>
            <center>
                <Divider hidden/>
                <Image src={iunnologo} />
            <h1>
                <ReactRotatingText items={["IUNNO", "IDK", "I don't know", "Yo no sé", "知りません", "Je ne sais pas", "Ich weiß es nicht", "我不知道", "انا لا اعرف"]} />
            </h1>
            <LoginForm/>
            </center></div>
        )
    }
}
